INSERT INTO `tbl_jenis_memo` (`jenis_memo_id`, `jenis_memo_perihal`, `jenis_memo_text1`, `jenis_memo_text2`, `jenis_memo_kepada`, `jenis_memo_cc`, `jenis_memo_owner`) VALUES
(10, 'PELEPASAN BPKB AYDA', '                                                                                                                        <span style=\"color: rgb(33, 37, 41); font-size: 18px;\">Sehubungan dengan telah lunasnya pembayaran  Unit AYDA, maka bersama memo ini kami mengajukan memo pelepasan BPKB AYDA dengan rincian data seperti di bawah ini :</span>                                                                                                                        ', '                                                                                                                        <span style=\"color: rgb(33, 37, 41); font-size: 18px;\">Demikianlah memo pelepasan BPKB AYDA ini kami sampaikan, atas perhatian dan kerjasamanya kami ucapkan terima kasih</span>                                                                                                                        ', 'CREDIT ADMIN', 'BANK RELATION', 'CREDIT ADMIN'),
(11, 'PELEPASAN BPKB LUNAS', '                                                <span style=\"color: rgb(33, 37, 41); font-size: 18px;\">Sehubungan dengan telah lunasnya Kredit, maka bersama memo ini kami mengajukan memo pelepasan BPKB lunas dengan rincian data seperti di bawah ini :</span>                                        ', '                                                                                                                                                <span style=\"color: rgb(33, 37, 41); font-size: 18px;\">Demikianlah memo pelepasan BPKB lunas  ini kami sampaikan, atas perhatian dan kerjasamanya kami ucapkan terima kasih</span>                                                                                                                                            ', 'CREDIT ADMIN', 'BANK RELATION', 'CREDIT ADMIN'),
(12, 'PEMINJAMAN BPKB', '                                                                        Melalui memo ini kami mengajukan peminjaman BPKB beserta kelengkapannya dengan maksud dan  rincian sebagai berikut :                                                                                ', '                                                                        Demikian memo peminjaman BPKB ini kami sampaikan, atas perhatian dan kerjasamanya kami ucapkan terimakasih                                                                                ', 'CREDIT ADMIN', 'BANK RELATION', 'CREDIT ADMIN'),
(13, 'PRIORITAS PELEPASAN BPKB', '                                                                                                                        <span style=\"color: rgb(33, 37, 41); font-size: 18px;\">Sehubungan dengan akan dilunasinya kredit dan nasabah menginginkan BPKB sudah ada terlebih dahulu, baru selanjutnya akan melakukan pelunasan. Maka dengan ini kami mengajukan memo prioritas pelepasan BPKB dengan rincian data seperti di bawah ini :</span>                                                                                                                        ', '                                                                                                                        <span style=\"color: rgb(33, 37, 41); font-size: 18px;\">Demikianlah memo prioritas pelepasan BPKB ini kami sampaikan, atas perhatian dan kerjasamanya kami ucapkan terima kasih</span>                                                                                                                        ', 'CREDIT ADMIN', 'BANK RELATION', 'CREDIT ADMIN'),
(15, 'PELEPASAN BPKB TITIPAN CABANG', '                                                <span style=\"color: rgb(33, 37, 41); font-size: 18px;\">Sehubungan dengan telah dititipkanya BPKB cabang ke kantor pusat, maka bersama memo ini kami mengajukan memo pelepasan Tttipan BPKB cabang dengan rincian data seperti di bawah ini :</span>                                        ', '                        <span style=\"color: rgb(33, 37, 41); font-size: 18px;\">Demikianlah memo pelepasan titipan BPKB cabang ini kami sampaikan, atas perhatian dan kerjasamanya kami ucapkan terima kasih</span>                    ', 'CREDIT ADMIN', 'BANK RELATION', 'CREDIT ADMIN');
